import React from 'react';
import { motion } from 'framer-motion';
import { ArrowRight } from 'lucide-react';
import { Link } from 'react-router-dom';

const Services = () => {
  const services = [
    {
      title: "Map PowerBoost",
      description: "Dominate Google Maps with our advanced embedding strategy. Get to the top 3 positions in your local market.",
      price: "$997/month",
      features: ["Google Maps embedding", "Authority site placement", "Monthly reporting", "30-day guarantee"],
      link: "/map-powerboost",
      gradient: "from-[#3abef9] to-[#007bff]"
    },
    {
      title: "Local Citations",
      description: "Build consistent NAP citations across 100+ directories. Improve your local search rankings and visibility.",
      price: "$497/month",
      features: ["100+ directory submissions", "NAP consistency", "Citation monitoring", "Monthly reports"],
      link: "/local-citations",
      gradient: "from-[#00ffff] to-[#3abef9]"
    },
    {
      title: "Cloud Stack Boost",
      description: "Advanced Google Maps iFrame cloud stacking for maximum local SEO impact and rapid ranking improvements.",
      price: "$1,497/month",
      features: ["Cloud-based stacking", "Advanced targeting", "Priority support", "Custom strategy"],
      link: "/cloud-stack-boost",
      gradient: "from-[#007bff] to-[#00ffff]"
    }
  ];

  const fadeInUp = {
    initial: { opacity: 0, y: 30 },
    whileInView: { opacity: 1, y: 0 },
    transition: { duration: 0.6 }
  };

  return (
    <section id="services" className="relative py-20 bg-gradient-to-b from-[#09090f] to-[#0f0f1a] overflow-hidden">
      {/* Space background effects */}
      <div className="absolute inset-0">
        <div className="absolute top-32 left-1/4 w-1 h-1 bg-[#3abef9]/50 rounded-full blur-[1px]" />
        <div className="absolute top-60 right-1/3 w-0.5 h-0.5 bg-white/40 rounded-full blur-[0.8px]" />
        <div className="absolute bottom-32 left-1/3 w-1.2 h-1.2 bg-[#00ffff]/60 rounded-full blur-[1.2px]" />
        <div className="absolute bottom-60 right-1/4 w-0.8 h-0.8 bg-[#3abef9]/45 rounded-full blur-[1px]" />
      </div>

      <div className="container mx-auto px-4 relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-white mb-6 bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent">
            Our Packages
          </h2>
          <p className="text-xl text-[#9ca3af] max-w-3xl mx-auto">
            Choose the perfect package to dominate your local market and start generating more leads today.
          </p>
        </motion.div>

        <div className="grid md:grid-cols-3 gap-8">
          {services.map((service, index) => (
            <motion.div
              key={index}
              {...fadeInUp}
              transition={{ delay: index * 0.1 }}
              className="bg-gradient-to-br from-[#10111a] to-[#0a0a0f] p-8 rounded-2xl border border-[#3abef9]/20 hover:border-[#3abef9]/40 transition-all duration-300 hover:shadow-[0_0_32px_0_rgba(58,190,249,0.15)] group"
            >
              <div className="mb-6">
                <h3 className="text-2xl font-bold text-white mb-3">
                  {service.title}
                </h3>
                <p className="text-[#9ca3af] mb-4">
                  {service.description}
                </p>
                <div className="text-3xl font-bold bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent">
                  {service.price}
                </div>
              </div>

              <ul className="mb-8 space-y-3">
                {service.features.map((feature, featureIndex) => (
                  <li key={featureIndex} className="flex items-center text-[#9ca3af]">
                    <div className="w-2 h-2 bg-[#3abef9] rounded-full mr-3" />
                    {feature}
                  </li>
                ))}
              </ul>

              <Link
                to={service.link}
                className="inline-flex items-center justify-center w-full px-6 py-3 bg-gradient-to-r from-[#3abef9] to-[#007bff] text-white font-semibold rounded-xl transition-all duration-300 hover:shadow-[0_0_20px_0_rgba(58,190,249,0.4)] group-hover:scale-105"
              >
                Learn More
                <ArrowRight className="w-4 h-4 ml-2 group-hover:translate-x-1 transition-transform" />
              </Link>
            </motion.div>
          ))}
        </div>

        {/* CTA Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
          className="mt-16 text-center"
        >
          <div className="bg-gradient-to-r from-[#3abef9]/10 to-[#007bff]/10 p-8 rounded-2xl border border-[#3abef9]/30">
            <h3 className="text-2xl font-bold text-white mb-4">
              Not Sure Which Package is Right?
            </h3>
            <p className="text-[#9ca3af] mb-6 max-w-2xl mx-auto">
              Let's discuss your specific needs and create a custom strategy to dominate your local market.
            </p>
            <button className="px-8 py-4 bg-gradient-to-r from-[#3abef9] to-[#007bff] text-white font-semibold rounded-xl transition-all duration-300 hover:shadow-[0_0_32px_0_rgba(58,190,249,0.4)] hover:scale-105">
              Get Free Strategy Call
            </button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Services;
